      <style>
  @import url('@ui5/webcomponents-base/dist/css/FontFace.css');

  body {
    font-family: '72', Arial, Helvetica, sans-serif;
  }
  #storybook-explorer-searchfield {
    background: transparent !important;
  }

  .docblock-argstable-body label[title] {
    background: #fff !important;
  }

  input:checked ~ span:first-of-type:not(:only-of-type),
  input:not(:checked) ~ span:last-of-type:not(:only-of-type) {
    background-color: rgba(0, 0, 0, 0.15) !important;
  }
  input:checked ~ span:last-of-type,
  input:not(:checked) ~ span:first-of-type {
    background-color: transparent !important;
  }
</style>

<script data-ui5-config type="application/json">
  {
    "theme": "sap_horizon"
  }
</script>
<link rel="icon" href="favicon.ico" />
 

    <style>
      #storybook-root[hidden] {
        display: none !important;
      }
    </style>

    
  </head>
  <body>
    <div id="root"></div>

    
    <script>
      
        
          window['FEATURES'] = {
  "argTypeTargetsV7": true,
  "legacyDecoratorFileOrder": false,
  "disallowImplicitActionsInRenderV8": true
};
        
      
        
          window['REFS'] = {};
        
      
        
          window['LOGLEVEL'] = "info";
        
      
        
          window['DOCS_OPTIONS'] = {
  "defaultName": "Docs",
  "autodocs": true
};
        
      
        
          window['CONFIG_TYPE'] = "PRODUCTION";
        
      
        
      
        
      
        
          window['TAGS_OPTIONS'] = {
  "dev-only": {
    "excludeFromDocsStories": true
  },
  "docs-only": {
    "excludeFromSidebar": true
  },
  "test-only": {
    "excludeFromSidebar": true,
    "excludeFromDocsStories": true
  }
};
        
      
        
          window['STORYBOOK_RENDERER'] = "react";
        
      
        
          window['STORYBOOK_BUILDER'] = "@storybook/builder-vite";
        
      
        
          window['STORYBOOK_FRAMEWORK'] = "/home/runner/work/ui5-webcomponents-react/ui5-webcomponents-react/node_modules/@storybook/react-vite";
        
      
    </script>
